INSERT INTO `encuesta` (`id`, `nombre`, `descripcion`, `instrucciones`, `mensaje`, `fecha`) VALUES
(1, 'Encuesta Estudiantes', 'Encuesta para Estudiantes', 'En su criterio, frente a cada pregunta y en la columna respectiva evalúe el grado de cumplimiento del enunciado, de acuerdo con la siguiente escala de calificación: 5.   Completamente de acuerdo  4.   De acuerdo  3.   Aceptablemente  2.   En desacuerdo  1.   Completamente en desacuerdo  0.   No sabe no responde  En caso de que la redacción de la pregunta no sea clara para usted por favor rellene el campo de observaciones con su opinión.', 'Recolectar información sobre la percepción que la comunidad universitaria tiene de los procesos académicos y administrativos desarrollados por la Institución para el logro de sus  objetivos misionales, con el fin de adelantar el proceso de autoevaluación institucional.', '2012-03-01 14:14:58'),
(2, 'Encuesta Profesores', 'Encuesta para Docentes', 'En su criterio, frente a cada pregunta y en la columna respectiva evalúe el grado de cumplimiento del enunciado, de acuerdo con la siguiente escala de calificación: 5.   Completamente de acuerdo  4.   De acuerdo  3.   Aceptablemente  2.   En desacuerdo  1.   Completamente en desacuerdo  0.   No sabe no responde  En caso de que la redacción de la pregunta no sea clara para usted por favor rellene el campo de observaciones con su opinión.', 'Recolectar información sobre la percepción que la comunidad universitaria tiene de los procesos académicos y administrativos desarrollados por la Institución para el logro de sus  objetivos misionales, con el fin de adelantar el proceso de autoevaluación institucional.', '2012-03-01 14:15:01'),
(3, 'Encuesta Administrativos', 'Encuesta para Administrativos', 'En su criterio, frente a cada pregunta y en la columna respectiva evalúe el grado de cumplimiento del enunciado, de acuerdo con la siguiente escala de calificación: 5.   Completamente de acuerdo  4.   De acuerdo  3.   Aceptablemente  2.   En desacuerdo  1.   Completamente en desacuerdo  0.   No sabe no responde  En caso de que la redacción de la pregunta no sea clara para usted por favor rellene el campo de observaciones con su opinión.', 'Recolectar información sobre la percepción que la comunidad universitaria tiene de los procesos académicos y administrativos desarrollados por la Institución para el logro de sus  objetivos misionales, con el fin de adelantar el proceso de autoevaluación institucional.', '2012-03-01 14:16:45');
